import react from "react";
import { useState } from "react";

function Inter(){

    const [activated, setActivated] = useState(false);

    useEffect(() => {
        // Code to run when the 'activated' value changes
        console.log("Activated value changed:", activated);
    }, [activated]);

    return(
        <div className="main">
            <div className="circle" onClick={() => setActivated(!activated)}></div>
        </div>
    );
}

export default Inter;
